import React, { useRef } from 'react';
import { Container } from './styles';
import { Input, Button } from '@material-ui/core';
import axios from 'axios';

const serverUrl = 'http://localhost:3001'; 

const Register = () => {

	const handleSubmit = async () => {
		const response = await axios.post( serverUrl + '/register'); 
		console.log(response, 'response');
	}
return (
	<Container>
		<Input placeholder="Enter name" name="name"/><br />
		<Input placeholder="Enter mobile number"  name="number" type="number" maxLength="10" /><br />
		<Input placeholder="Enter email" name="email" /><br /><br />
		<Button variant="contained" color="primary" onClick={() => handleSubmit()}>Login</Button>
	</Container>
  )
}
export default Register ;
